exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.uuks.org/b/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/zhangjie[^>]+>/,"mulu-tuijian"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)},webview:!0})};